from typing import List, Union
from accessor import setValue

number_of_columns = 4
number_of_rows = 4

def init():
    csv_text = ''
    for y_idx in range(number_of_rows):
        for x_idx in range(number_of_columns):
            csv_text += f'data in cell {y_idx}-{x_idx}'
            if (x_idx == (number_of_columns - 1)):
                csv_text += '\n'
            else:
                csv_text += ','

    setValue(['table'], csv_text)
    return

def on_table_change(path: List[Union[str, int]], value):
    print(value)
    return

